import{_ as i,o as e,c as o,z as t,a as c}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 17.1-505 Circuit court of county to constitute circuit court of certain cities.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/17.1-505.md","filePath":"vacode/17.1-505.md"}'),r={name:"vacode/17.1-505.md"},n=t("h1",{id:"§-17-1-505-circuit-court-of-county-to-constitute-circuit-court-of-certain-cities",tabindex:"-1"},[c("§ 17.1-505 Circuit court of county to constitute circuit court of certain cities. "),t("a",{class:"header-anchor",href:"#§-17-1-505-circuit-court-of-county-to-constitute-circuit-court-of-certain-cities","aria-label":'Permalink to "§ 17.1-505 Circuit court of county to constitute circuit court of certain cities."'},"​")],-1),a=t("p",null,"The circuit court of any county, within which is situated any city which has undergone transition from a city of the second class to a city of the first class since the Constitution of 1902, went into effect, shall have concurrent jurisdiction with the circuit court of such city in all proceedings at law or in equity, except criminal prosecutions; and the circuit court of such county shall constitute the circuit court of such city. This section shall not apply to the Cities of Bristol, Colonial Heights, Fredericksburg, Martinsville, Salem and Suffolk for which separate circuit courts have heretofore been established and which are continued.",-1),s=t("p",null,[c("Code 1919, § 5911, § 17-118; 1920, p. 607; 1962, c. 237; 1968, c. 107; 1971, Ex. Sess., c. 27; 1998, c. "),t("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0872",target:"_blank",rel:"noreferrer"},"872"),c(".")],-1),u=[n,a,s];function h(l,f,d,p,_,y){return e(),o("div",null,u)}const v=i(r,[["render",h]]);export{g as __pageData,v as default};
